const DEFAULT_TASKS = [
	{
		name: "Go to gym",
		priority: 3,
		status: 3,
		id: Math.random(),
	},
	{
		name: "Read a book",
		priority: 1,
		status: 1,
		id: Math.random(),
	},
	{
		name: "Go to market",
		priority: 2,
		status: 2,
		id: Math.random(),
	},
	{
		name: "Restart Learning Solidworks",
		priority: 3,
		status: 3,
		id: Math.random(),
	},
	{
		name: "change slider to scroll",
		priority: 3,
		status: 1,
		id: Math.random(),
	},
	{
		name: "To publish the article",
		priority: 2,
		status: 2,
		id: Math.random(),
	},
];

export default DEFAULT_TASKS;
